import React from 'react'
import { View, Text } from 'react-native'

import {useDispatch, useSelector } from 'react-redux'
import { counterReducer } from './redux/counterReducer'
const counter = () => {
    const dispatch = useDispatch;
    const counter = useSelector(data => data.count )
    return (
        <View>
            <Text>
                counter: {state.count}
            </Text>
            <button title='increment' onPress={() =>dispatch(setIncrement(counter))} ></button>
            <button title='decrement' onPress={() =>dispatch(setDecrement(counter))} ></button>
        </View>
    )
}

export default counter
